let textToBeCopied = "";

const body = document.querySelector("body");
const paragraphsEl = document.querySelector(".paragraphs");
const generateBtn = document.querySelector("form button");
const copyBtn = document.querySelector(".copy");
const input = document.querySelector("input");

const createAndAppendParagraph = (text) => {
  const p = document.createElement("p");
  p.innerText = text;
  paragraphsEl.append(p);
};
const copyBtnHandler = (text) => {
  copyText(text);
};
const generateParagraphs = (qty) => {
  paragraphsEl.innerHTML = "";
  textToBeCopied = "";

  if (qty < 1) qty = 1;
  if (qty > paragraphs.length) qty = paragraphs.length;

  for (i = 0; i < qty; i++) {
    textToBeCopied += `${paragraphs[i]}\n`;
    createAndAppendParagraph(paragraphs[i]);
  }
};
const copyText = (text) => {
  navigator.clipboard.writeText(text);
};

copyBtn.addEventListener("click", () => {
  copyBtnHandler(textToBeCopied);
  body.append(new Toast().get());
});
generateBtn.addEventListener("click", (e) => {
  e.preventDefault();
  generateParagraphs(Number(input.value));
});

generateParagraphs(3);

class Toast {
  constructor() {
    const p = document.createElement("p");
    const span = document.createElement("span");
    const div = document.createElement("div");

    div.classList.add("toast");
    p.innerText = "Text Copied";
    span.innerText = "👋";

    p.insertAdjacentElement("afterbegin", span);
    div.append(p);

    this.element = div;
  }

  get = () => {
    setTimeout(() => {
      this.element.remove();
    }, 3000);

    return this.element;
  };
}

